}},{"type":"object","name":"TableColumn","id":"p1320","attributes":{"field":"standard_unrestricted","title":"Standard (unrestricted)","formatter":{"type":"object","name":"NumberFormatter","id":"p1319","attributes":{"format":"0.0%"}},"editor":{"type":"object","name":"StringEditor","id":"p1322"}}}],"index_position":null}},{"type":"object","name":"Column","id":"p1331","attributes":{"sizing_mode":"stretch_width","children":[{"type":"object","name":"Div","id":"p1329","attributes":{"width":350,"text":"&lt;b&gt;Weight methodologies&lt;/b&gt;&lt;br&gt;&lt;b&gt;Standard (restricted):&lt;/b&gt; Single risk-on guardrail set (cash floors, inverse caps, turnover) regardless of regime.&lt;br&gt;&lt;b&gt;Standard (unrestricted):&lt;/b&gt; Same baseline data but long-only 0\u2013100% bounds and budget constraint only.&lt;br&gt;&lt;b&gt;Regime (restricted):&lt;/b&gt; Guardrails adapt to detected regime before solving the constrained Sharpe optimizer.&lt;br&gt;&lt;b&gt;Regime (unrestricted):&lt;/b&gt; Regime-aware inputs with long-only bounds only (no guardrails)."}},{"type":"object","name":"Div","id":"p1330","attributes":{"width":350,"text":"&lt;b&gt;Simulated performance (since 2016-01-05)&lt;/b&gt;&lt;br&gt;Standard (restricted): 5.7%&lt;br&gt;Standard (unrestricted): 8.1%&lt;br&gt;Regime (restricted): 6.1%&lt;br&gt;Regime (unrestricted): 13.0%"}}]}}]}},{"id":"p1296"},{"id":"p1297"}]}}}},{"type":"object","name":"TabPanel","id":"p1625","attributes":{"title":"vs Academia","child":{"type":"object","name":"Column","id":"p1624","attributes":{"children":[{"type":"object","name":"Div","id":"p1621","attributes":{"text":"\n        &lt;h1 style=\"color: #2c3e50;\"&gt;\ud83e\udde0 Advanced Analysis: ML-Enhanced RAAAL&lt;/h1&gt;\n        &lt;p style=\"color: #7f8c8d;\"&gt;\n            Comparing regime-adjusted allocation with Hierarchical Risk Parity (HRP),\n            ensemble learning regime detection, and network-based risk analysis.\n        &lt;/p&gt;\n        &lt;hr&gt;\n    "}},{"type":"object","name":"Div","id":"p1339","attributes":{"text":"\n    &lt;h2&gt;\ud83d\udcca Performance Comparison: RAAAL vs HRP&lt;/h2&gt;\n    &lt;table style=\"width:100%; border-collapse: collapse; font-size: 14px;\"&gt;\n        &lt;thead&gt;\n            &lt;tr style=\"background-color: #2b3e50; color: white;\"&gt;\n                &lt;th style=\"padding: 10px; text-align: left; border: 1px solid #ddd;\"&gt;Strategy&lt;/th&gt;\n                &lt;th style=\"padding: 10px; text-align: right; border: 1px solid #ddd;\"&gt;Annualized Return&lt;/th&gt;\n            &lt;/tr&gt;\n        &lt;/thead&gt;\n        &lt;tbody&gt;\n    \n            &lt;tr style=\"background-color: #f9f9f9;\"&gt;\n                &lt;td style=\"padding: 10px; border: 1px solid #ddd;\"&gt;Standard (Restricted)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right; border: 1px solid #ddd; color: #27ae60; font-weight: bold;\"&gt;\n                    5.72%\n                &lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #ffffff;\"&gt;\n                &lt;td style=\"padding: 10px; border: 1px solid #ddd;\"&gt;Standard (Unrestricted)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right; border: 1px solid #ddd; color: #27ae60; font-weight: bold;\"&gt;\n                    8.08%\n                &lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #f9f9f9;\"&gt;\n                &lt;td style=\"padding: 10px; border: 1px solid #ddd;\"&gt;Regime (Restricted)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right; border: 1px solid #ddd; color: #27ae60; font-weight: bold;\"&gt;\n                    6.06%\n                &lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #ffffff;\"&gt;\n                &lt;td style=\"padding: 10px; border: 1px solid #ddd;\"&gt;Regime (Unrestricted)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right; border: 1px solid #ddd; color: #27ae60; font-weight: bold;\"&gt;\n                    13.02%\n                &lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #f9f9f9;\"&gt;\n                &lt;td style=\"padding: 10px; border: 1px solid #ddd;\"&gt;HRP (Regime Unrestricted)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right; border: 1px solid #ddd; color: #27ae60; font-weight: bold;\"&gt;\n                    2.03%\n                &lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #ffffff;\"&gt;\n                &lt;td style=\"padding: 10px; border: 1px solid #ddd;\"&gt;HRP (Regime Restricted)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right; border: 1px solid #ddd; color: #27ae60; font-weight: bold;\"&gt;\n                    2.05%\n                &lt;/td&gt;\n            &lt;/tr&gt;\n        \n        &lt;/tbody&gt;\n    &lt;/table&gt;\n    &lt;div style=\"margin-top: 15px; padding: 10px; background-color: #fff3cd; border-left: 4px solid #ffc107; border-radius: 5px;\"&gt;\n        &lt;p style=\"margin: 5px 0; color: #856404; font-size: 13px;\"&gt;&lt;strong&gt;\u26a0\ufe0f HRP vs RAAAL Comparison:&lt;/strong&gt;&lt;/p&gt;\n        &lt;ul style=\"margin: 5px 0 5px 20px; color: #856404; font-size: 12px;\"&gt;\n            &lt;li&gt;&lt;strong&gt;RAAAL (13.08%):&lt;/strong&gt; Optimizes for risk-adjusted returns (Sharpe ratio) with regime-specific constraints. \n                Dynamically adjusts to market conditions.&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;HRP (2.03-2.06%):&lt;/strong&gt; Pure diversification strategy based on correlation clustering. \n                Does NOT optimize for returns - focuses solely on balanced risk allocation.&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Why the difference?&lt;/strong&gt; HRP avoids concentration risk but sacrifices return potential. \n                RAAAL balances risk AND return, leading to higher performance in favorable regimes.&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Use case:&lt;/strong&gt; HRP is suitable for ultra-conservative portfolios prioritizing stability over growth. \n                RAAAL is designed for tactical allocation seeking risk-adjusted outperformance.&lt;/li&gt;\n        &lt;/ul&gt;\n    &lt;/div&gt;\n    "}},{"type":"object","name":"Row","id":"p1622","attributes":{"children":[{"type":"object","name":"Column","id":"p1471","attributes":{"children":[{"type":"object","name":"Figure","id":"p1340","attributes":{"width":1200,"height":200,"x_range":{"type":"object","name":"DataRange1d","id":"p1341"},"y_range":{"type":"object","name":"DataRange1d","id":"p1342","attributes":{"start":0,"end":1}},"x_scale":{"type":"object","name":"LinearScale","id":"p1350"},"y_scale":{"type":"object","name":"LinearScale","id":"p1351"},"title":{"type":"object","name":"Title","id":"p1343","attributes":{"text":"Rule-Based Regime Detection"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1399","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1389","attributes":{"selected":{"type":"object","name":"Selection","id":"p1390","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:indices",[{"type":"object","name":"CustomJS","id":"p1468","attributes":{"args":{"type":"map","entries":[["source",{"id":"p1389"}],["info",{"type":"object","name":"Div","id":"p1466","attributes":{"width":1200,"text":"&lt;p&gt;Click on a regime segment to see allocation details&lt;/p&gt;"}}],["tickers",["SPY","SH","TLT","TBT","LQD","DBC","GLD","HYG","BIL"]]]},"code":"\n            const idx = source.selected.indices[0];\n            if (idx === undefined) { return; }\n            \n            const startDate = new Date(source.data['left'][idx]).toISOString().slice(0, 10);\n            const endDate = new Date(source.data['right'][idx]).toISOString().slice(0, 10);\n            const regime = source.data['regime'][idx];\n            \n            // Collect all weights\n            const weights = [];\n            for (let i = 0; i &lt; tickers.length; i++) {\n                const ticker = tickers[i];\n                const startVal = source.data['start_' + ticker][idx] ?? 0;\n                const endVal = source.data['end_' + ticker][idx] ?? 0;\n                if (startVal &gt; 0.001 || endVal &gt; 0.001) {\n                    weights.push({\n                        ticker: ticker,\n                        start: startVal,\n                        end: endVal,\n                        change: Math.abs(startVal - endVal)\n                    });\n                }\n            }\n            \n            // Sort by end weight descending\n            weights.sort((a, b) =&gt; b.end - a.end);\n            \n            const lines = weights.map(w =&gt; \n                `${w.ticker}: ${(w.start * 100).toFixed(1)}% \u2192 ${(w.end * 100).toFixed(1)}%`\n            );\n            \n            const body = lines.length ? lines.join('&lt;br&gt;') : 'No allocations';\n            info.text = `&lt;div style=\"padding: 10px; background-color: #f8f9fa; border-left: 4px solid #007bff; margin: 10px 0;\"&gt;\n                &lt;b&gt;${regime}&lt;/b&gt; (${startDate} to ${endDate})&lt;br&gt;&lt;br&gt;${body}\n            &lt;/div&gt;`;\n        "}}]]]},"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p1391"},"data":{"type":"map","entries":[["left",[1451952000000.0,1456963200000.0,1466985600000.0,1467676800000.0,1541376000000.0,1547769600000.0,1582502400000.0,1590537600000.0,1594252800000.0,1597276800000.0,1599782400000.0,1600387200000.0,1620000000000.0,1620604800000.0,1643068800000.0,1643673600000.0,1645574400000.0,1646179200000.0,1646784000000.0,1647388800000.0,1651708800000.0,1652918400000.0,1654819200000.0,1656979200000.0,1659398400000.0,1660003200000.0,1660608000000 t;ul&gt;\n                &lt;li&gt;&lt;strong&gt;Nodes:&lt;/strong&gt; 9&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Edges:&lt;/strong&gt; 7&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Network Density:&lt;/strong&gt; 0.194&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Avg Clustering:&lt;/strong&gt; 0.439&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Connected Components:&lt;/strong&gt; 4&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Systemic Risk Assets:&lt;/strong&gt; LQD, HYG, TLT&lt;/li&gt;\n            &lt;/ul&gt;\n        &lt;/div&gt;\n        \n        &lt;div style=\"margin: 20px 0; padding: 15px; background-color: #ecf0f1; border-left: 4px solid #3498db; border-radius: 5px;\"&gt;\n            &lt;h3&gt;Risk Off&lt;/h3&gt;\n            &lt;ul&gt;\n                &lt;li&gt;&lt;strong&gt;Nodes:&lt;/strong&gt; 9&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Edges:&lt;/strong&gt; 15&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Network Density:&lt;/strong&gt; 0.417&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Avg Clustering:&lt;/strong&gt; 0.419&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Connected Components:&lt;/strong&gt; 2&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Systemic Risk Assets:&lt;/strong&gt; SH, DBC, HYG&lt;/li&gt;\n            &lt;/ul&gt;\n        &lt;/div&gt;\n        \n        &lt;div style=\"margin: 20px 0; padding: 15px; background-color: #ecf0f1; border-left: 4px solid #3498db; border-radius: 5px;\"&gt;\n            &lt;h3&gt;Inflation&lt;/h3&gt;\n            &lt;ul&gt;\n                &lt;li&gt;&lt;strong&gt;Nodes:&lt;/strong&gt; 9&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Edges:&lt;/strong&gt; 16&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Network Density:&lt;/strong&gt; 0.444&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Avg Clustering:&lt;/strong&gt; 0.471&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Connected Components:&lt;/strong&gt; 3&lt;/li&gt;\n                &lt;li&gt;&lt;strong&gt;Systemic Risk Assets:&lt;/strong&gt; TBT, SPY, LQD&lt;/li&gt;\n            &lt;/ul&gt;\n        &lt;/div&gt;\n        \n    &lt;p style=\"color: #555; font-size: 12px;\"&gt;\n        &lt;strong&gt;Network Metrics:&lt;/strong&gt; Higher density indicates stronger correlations.\n        Systemic risk assets are identified using centrality measures (degree, betweenness, eigenvector).\n    &lt;/p&gt;\n    "}}]}}}},{"type":"object","name":"TabPanel","id":"p1720","attributes":{"title":"vs Buffett","child":{"type":"object","name":"Column","id":"p1719","attributes":{"sizing_mode":"stretch_width","children":[{"type":"object","name":"Div","id":"p1717","attributes":{"text":"\n        &lt;h1 style=\"color: #2c3e50;\"&gt;\ud83c\udfdb\ufe0f RAAAL vs Berkshire Hathaway&lt;/h1&gt;\n        &lt;p style=\"color: #7f8c8d;\"&gt;\n            Comparing tactical regime-aware allocation against Warren Buffett's diversified conglomerate.\n            BRK-B represents a simple buy-and-hold strategy in a fundamentally sound, actively managed business.\n        &lt;/p&gt;\n        &lt;hr&gt;\n    "}},{"type":"object","name":"Div","id":"p1718","attributes":{"text":"\n    &lt;div style=\"margin: 20px 0; padding: 20px; background-color: #fff3cd; border-left: 4px solid #ffc107; border-radius: 5px;\"&gt;\n        &lt;h3&gt;\ud83d\udca1 Why Compare to BRK-B?&lt;/h3&gt;\n        &lt;p&gt;\n            Berkshire Hathaway is Warren Buffett's holding company and represents a \"&lt;strong&gt;one-decision&lt;/strong&gt;\" investment:\n        &lt;/p&gt;\n        &lt;ul&gt;\n            &lt;li&gt;&lt;strong&gt;Built-in Diversification&lt;/strong&gt;: Insurance, utilities, railroads, energy, consumer brands, and public equities&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Active Capital Allocation&lt;/strong&gt;: Buffett deploys cash opportunistically during market dislocations&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Tax Efficiency&lt;/strong&gt;: No dividend distributions, deferred capital gains&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Fortress Balance Sheet&lt;/strong&gt;: Typically holds $100B+ in cash and T-bills&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Long-term Focus&lt;/strong&gt;: Historical ~10% annualized returns with lower volatility than S&amp;P 500&lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;p&gt;\n            If RAAAL's tactical complexity doesn't meaningfully outperform BRK-B on a risk-adjusted basis, \n            the simpler approach may be superior for most investors.\n        &lt;/p&gt;\n    &lt;/div&gt;\n    "}},{"type":"object","name":"Div","id":"p1626","attributes":{"text":"\n    &lt;h2&gt;\ud83d\udcca Performance Comparison: RAAAL vs BRK-B&lt;/h2&gt;\n    &lt;table style=\"width: 100%; border-collapse: collapse; margin: 20px 0;\"&gt;\n        &lt;thead&gt;\n            &lt;tr style=\"background-color: #2c3e50; color: white;\"&gt;\n                &lt;th style=\"padding: 12px; text-align: left;\"&gt;Strategy&lt;/th&gt;\n                &lt;th style=\"padding: 12px; text-align: right;\"&gt;Total Return&lt;/th&gt;\n                &lt;th style=\"padding: 12px; text-align: right;\"&gt;Annualized&lt;/th&gt;\n                &lt;th style=\"padding: 12px; text-align: right;\"&gt;Volatility&lt;/th&gt;\n                &lt;th style=\"padding: 12px; text-align: right;\"&gt;Sharpe&lt;/th&gt;\n                &lt;th style=\"padding: 12px; text-align: right;\"&gt;Max DD&lt;/th&gt;\n            &lt;/tr&gt;\n        &lt;/thead&gt;\n        &lt;tbody&gt;\n    \n            &lt;tr style=\"background-color: #ecf0f1;\"&gt;\n                &lt;td style=\"padding: 10px; font-weight: bold;\"&gt;RAAAL (Regime-Aware)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;78.7%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;6.06%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;5.51%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;1.10&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;-9.1%&lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #ffffff;\"&gt;\n                &lt;td style=\"padding: 10px; font-weight: bold;\"&gt;RAAAL (Standard)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;73.1%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;5.72%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;5.86%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;0.98&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;-9.1%&lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #ecf0f1;\"&gt;\n                &lt;td style=\"padding: 10px; font-weight: bold;\"&gt;BRK-B + Cash (Regime-Aware)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;165.4%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;10.40%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;12.64%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;0.82&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;-22.6%&lt;/td&gt;\n            &lt;/tr&gt;\n        \n            &lt;tr style=\"background-color: #ffffff;\"&gt;\n                &lt;td style=\"padding: 10px; font-weight: bold;\"&gt;BRK-B (Buy &amp; Hold)&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;220.2%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;12.51%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;19.53%&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;0.64&lt;/td&gt;\n                &lt;td style=\"padding: 10px; text-align: right;\"&gt;-31.9%&lt;/td&gt;\n            &lt;/tr&gt;\n        \n        &lt;/tbody&gt;\n    &lt;/table&gt;\n    &lt;div style=\"margin-top: 20px; padding: 15px; background-color: #e8f4f8; border-left: 4px solid #3498db; border-radius: 5px;\"&gt;\n        &lt;h4&gt;\ud83d\udccc Key Insights&lt;/h4&gt;\n        &lt;ul&gt;\n            &lt;li&gt;&lt;strong&gt;BRK-B (Buy &amp; Hold)&lt;/strong&gt;: 100% Berkshire Hathaway - Buffett's diversified conglomerate&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;BRK-B + Cash (Regime-Aware)&lt;/strong&gt;: Tactical allocation between BRK-B and money market using regime rules:\n                &lt;ul style=\"margin-top: 5px; margin-left: 20px;\"&gt;\n                    &lt;li&gt;Risk-On: 80% BRK-B / 20% Cash&lt;/li&gt;\n                    &lt;li&gt;Risk-Off: 30% BRK-B / 70% Cash (defensive)&lt;/li&gt;\n                    &lt;li&gt;Inflation: 50% BRK-B / 50% Cash&lt;/li&gt;\n                &lt;/ul&gt;\n            &lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;RAAAL Regime-Aware&lt;/strong&gt;: Multi-asset tactical allocation (stocks, bonds, commodities, gold)&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;RAAAL Standard&lt;/strong&gt;: Sharpe-optimized portfolio without regime adjustments&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Sharpe Ratio&lt;/strong&gt;: Risk-adjusted return (higher is better) = Annual Return \u00f7 Volatility&lt;/li&gt;\n            &lt;li&gt;&lt;strong&gt;Max Drawdown&lt;/strong&gt;: Largest peak-to-trough decline (lower is better)&lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;p style=\"margin-top: 10px; font-style: italic; color: #555;\"&gt;\n            The BRK-B + Cash strategy tests whether simple regime-aware timing with just two assets \n            (Buffett + cash) can match complex multi-asset portfolios.\n        &lt;/p&gt;\n    &lt;/div&gt;\n    "}},{"type":"object","name":"Figure","id":"p1627","attributes":{"wid
